function GetData(){
    const [data, setData] = useState([]);

    useEffect( () => {
        fetch('http://localhost:1234/staff', {
            method: 'GET',
        })
        .then((res) => res.json())
        .then((data) => {
            console.log(data, "userData")
            setData(data)
        })
    }, [])

    const content = ( 
        <>
            <table>
                <tr>
                    <th>Name</th>
                    <th>Team</th>
                    <th>Age</th>
                </tr>
                {data.map( i => {
                    return (<tr>
                                <td>{i.Name}</td>
                                <th>{i.Team}</th>
                                <th>{i.Age}</th>
                            </tr>)
                })}
            </table>
        </>
    )
    return content  
}



export default function Staff(){
   return   <>
